import React from 'react';

const SinhVien = ({ student }) => {
  const { id, name, mssv, internship } = student;

  return (
    <div>
      <h3>{name}</h3>
      <p>MSSV: {mssv}</p>
      <p>ID: {id}</p>
      <p>Quá trình thực tập: {internship}</p>
      <hr />
    </div>
  );
};

export default SinhVien;
